# This file should contain all the record creation needed to seed the database with its default values.
# The data can then be loaded with the rails db:seed command (or created alongside the database with db:setup).
#
# Examples:
#
#   movies = Movie.create([{ name: 'Star Wars' }, { name: 'Lord of the Rings' }])
#   Character.create(name: 'Luke', movie: movies.first)
beginner = 'beginner'
intermediate = 'intermediate'
advanced = 'advanced'

strength = 'strength'
cardio = 'cardio'
flexibility = 'flexibility'
str_cardio = 'str_cardio'
str_flex = 'str_flex'

exercises = [
    {name: 'Barbell Bench Press', difficulty: beginner, duration: , instructions: 'Setup. Lie on the flat bench with your eyes under the bar. Grab the bar. Put your pinky on the ring marks of your bar. Unrack. Take a big breath and unrack the bar by straightening your arms. Lower the bar. Lower it to your mid-chest while tucking your elbows 75Â°. Press.', type: strength, video_url: }, 
    {name: 'Incline Barbell Bench Press', difficulty: intermediate, duration: , instructions: 'Lie flat on an incline bench at 45 degrees and set your hands just outside of shoulder width. Set your shoulder blades by pinching them together and driving them into the bench. Take a deep breath and allow your spotter to help you with the lift off in order to maintain tightness through your upper back. Let the weight settle and ensure your upper back remains tight after lift off. Inhale and allow the bar to descend slowly by unlocking the elbows. Lower the bar in a straight line to the base of the sternum (breastbone) and touch the chest. Push the bar back up in a straight line by pressing yourself into the bench, driving your feet into the floor for leg drive, and extending the elbows.', type: strength, video_url: }, 
    {name: 'Dumbbell Bench Press', difficulty: beginner, duration: , instructions: 'Pick up the dumbbells off the floor using a neutral grip (palms facing in). Position the ends of the dumbbells in your hip crease, and sit down on the bench. To get into position, lay back and keep the weights close to your chest. Once you are in position, take a deep breath, and press the dumbbells to lockout at the top. Slowly lower the dumbbells under control as far as comfortably possible (the handles should be about level with your chest). Contract the chest and push the dumbbells back up to the starting position.', type: strength, video_url: }, 
    {name: 'Dumbbell Flye', difficulty: beginner, duration: , instructions: 'Pick up the dumbbells off the floor using a neutral grip (palms facing in). Position the ends of the dumbbells in your hip crease, and sit down on the bench. To get into position, lay back and keep the weights close to your chest. Once you are in position, take a deep breath, and press the dumbbells to lockout at the top. Slowly lower the dumbbells under control as far as comfortably possible (the handles should be about level with your chest). Contract the chest and push the dumbbells back up to the starting position.', type: strength, video_url: }, 
    {name: 'Decline Barbell Bench Press', difficulty: intermediate, duration: , instructions: 'Place the bench at a 15-30 degree decline. Inhale and allow the bar to descend slowly by unlocking the elbows. Lower the bar in a straight line to just below your sternum (breastbone) and touch the chest. Push the bar back up in a straight line by pressing yourself into the bench and extending the elbows.', type: strength, video_url: }, 
    {name: 'Incline Dumbbell Flye', difficulty: intermediate, duration: , instructions: 'Place the bench at a 45 degree angle. Position the ends of the dumbbells in your hip crease, and sit down on an incline bench. To get into position, lay back and keep the weights close to your chest. Once you are in position, take a deep breath, then press the dumbbells to lockout at the top.', type: strength, video_url: }, 
    {name: 'Decline Dumbbell Flye', difficulty: intermediate, duration: , instructions: 'Place the bench at a 15-30 degree decline. Pick up the dumbbells off the floor using a neutral grip (palms facing in). Position the ends of the dumbbells in your hip crease, and sit down on an decline bench. To get into position, lay back and keep the weights close to your chest. Once you are in position, take a deep breath, then press the dumbbells to lockout at the top. Slightly retract your shoulder blades, unlock your elbows, and slowly lower the dumbbells laterally while maintaining the angle at your elbow. Once the dumbbells reach chest level, reverse the movement by squeezing your pecs together and bringing the dumbbells back to their starting position.', type: strength, video_url: }, 
    {name: 'Standard Push-up', difficulty: beginner, duration: , instructions: 'Get down on all fours, placing your hands slightly wider than your shoulders. Straighten your arms and legs. Lower your body until your chest nearly touches the floor. Pause, then push yourself back up. Repeat.', type: str_cardio, video_url: }, 
    {name: 'Military Push-up', difficulty: intermediate, duration: , instructions: 'Get down on all fours placing your hands at shoulder width. Straighten your arms and legs. Lower your body until your chest nearly touches the floor with your elbows tucked tightly into your ribcage. Pause and then push yourself back up. Repeat.', type: str_cardio, video_url: }, 
    {name: 'Dive Bomber Push-up', difficulty: intermediate, duration: , instructions: 'Start off on your hands and knees on the floor, width your feet and hands set at shoulder width. Then lift your hips up towards the ceiling and straighten your legs so that your body looks like an upside down V shape from the side. Aim to create a straight line through your body from your hands, arms, shoulders to your hips. From this top position, bend your elbows and lower your head forwards and down towards the floor between your hands, whilst keeping your hips up above your shoulders. Just before your head touches the floor, start to move your head and shoulders forwards in front of your hands and lower your hips down to the same height as your ankles and shoulders, so that you are in a low plank (which also respembles to bottom position of a basic push-up). From this bottom position, move your head and shoulders backwards, as you bend and push your hips upwards. Straighten your arms to return to the top position of the upside down V, also known as downward dog in yoga. Aim to keep your elbows pointing backwards towards your hips rather than flaring them out to the sides during this movement. It will keep your shoulders safer and increase the focus of the exercise on your triceps', type: str_cardio, video_url: }, 
    {name: 'Diamond Push-up', difficulty: intermediate, duration: , instructions: "Position your index fingers and thumbs so they're touching, forming a diamond shape, and extend your arms so that your body is elevated and forms a straight line from your head to your feet. Lower your chest towards your hands, ensuring you don't flare your elbows out to the sides and keeping your back flat.", type: str_cardio, video_url: }, 
    {name: 'Wide Push-up', difficulty: beginner, duration: , instructions: "Keep your shoulders, spine, and hips in a straight line. Lengthen your spine to keep your back straight. Make sure your hips don't sag down or point upward. Look at a spot on the floor ahead of you as you keep your neck neutral. Engage your core and gluteal muscles when you do the exercise. Hands should be a few centimeters farther apart than a standard push-up.", type: str_cardio, video_url: }, 
    {name: 'Dumbbell Squeeze Press', difficulty: advanced, duration: , instructions: 'Take the dumbbells in your hands and lay down on the bench. Place the dumbbells together side by side and lift them up over your chest and squeeze the pectoral muscles with intensity. Lower them down together and touching each other and then push the dumbbells back up.', type: strength, video_url: }, 
    {name: 'Incline Dumbbell Bench Press', difficulty: intermediate, duration: , instructions: 'Set an adjustable bench to an incline of 30-45 degrees. Lie on your back on the bench and hold a pair of dumbbells directly above your shoulders with your arms fully extended. Pull your shoulder blades together, and slightly stick out your chest. Lower both dumbbells to the sides of your chest.', type: strength, video_url: }, 
    {name: 'Decline Dumbbell Bench Press', difficulty: intermediate, duration: , instructions: 'Place the bench at a 15-30 degree decline. Hold a dumbbell in each hand, shoulder-width apart and overhand grip. Lie back on a decline bench and extend your arms straight above you. Lower the weights slowly until they reach your chest, then push the dumbbells back to starting position.', type: strength, video_url: }, 
    {name: 'Close-grip Barbell Bench Press', difficulty: intermediate, duration: , instructions: 'Lie flat on the bench using a close grip (about shoulder width). Lift the bar with assistance from the rack, arms locked, and holding bar straight over you. Inhale and slowly bring the bar down toward your chest keeping elbows close to your body for the entire exercise.', type: strength, video_url: }, 
    {name: 'Seated Machine Chest Press', difficulty: beginner, duration: , instructions: 'Starting Position: Sit with your back firmly supported against the backrest. Gently exhale and slowly perform a pressing movement, extending your elbows infront, while maintaining a neutral wrist position, and keep your head aligned with your spine while avoiding any arching in your lower back.', type: strength, video_url: }, 
    {name: 'Drop Push-up', difficulty: advanced, duration: , instructions: "Place two platforms or boxes about 2 feet apart from each other then get into a push up position with your feet extended behind you and placing your hands on the boxes. Drop from the platforms by pushing up off of the boxes with your hands, with as much force as possible, and landing on the ground, hands absorbing the impact. Push yourself back up and extend your arms back onto the boxes.", type: str_cardio, video_url: }, 
    {name: 'Chest Dip', difficulty: beginner, duration: , instructions: 'Take a big breath, hold it and lower yourself. Break parallel by dipping until your shoulders are below your elbows. Come back up by straightening your arms. Lockout your dips by raising your chest at the top again.', type: str_cardio, video_url: }, 
    {name: 'Clap Push-up', difficulty: advanced, duration: , instructions: 'Begin in the "up" position of a push-up: arms extended, back and neck in a straight line, and core tight. Descend into the bottom position of the push-up by flexing at the elbows until they reach a 90-degree position. Push upwards as powerfully as possible through your hands to propel yourself upwards off the ground and into the air. Bring your hands together to complete a clap while in the air. Return to the starting position and immediately transition into a subsequent repetition.', type: str_cardio, video_url: }, 
    {name: 'Cable Crossover', difficulty: intermediate, duration: , instructions: "Place pulleys in position above your head and select the resistance that will be used. Hold one pulley in each hand. Move forward in an imaginary straight line between the pulleys while pulling your arms together in front of you. You should be be slightly bent forward from your waist. This is the starting position for the exercise. Bend your elbows slightly and extend your arms to your sides in a wide arc. Continue performing this movement until you feel a stretch in your chest. Inhale while you do so. Keep in mind that throughout the movement, the arms and torso should remain stationary; the movement should only occur at the shoulder joint. Bring your arms back to the starting position as you exhale. Be sure to use the same arc you used to lower the weights. Hold your position for a second when you reach the starting position and repeat the movement for the desired number of reps.", type: strength, video_url: }, 
    {name: 'Seated Dumbbell Tricep Extension', difficulty: beginner, duration: , instructions: 'Sit on a bench and hold one dumbbell with both hands directly above your head. Slowly flex your elbows and lower the weight behind your head as you keep your upper arms still. Extend your arms and repeat.', type: strength, video_url: }, 
    {name: 'Pike Push-ups', difficulty: intermediate, duration: , instructions: 'Assume a pushup position on the floor. Your arms should be straight and your hands should be shoulder-width apart. Now lift up your hips so that your body forms an upside down V. Your legs and arms should stay as straight as possible. Bend your elbows and lower your upper body until the top of your head nearly touches the floor. Pause, and then push yourself back up until your arms are straight.', type: str_cardio, video_url: }, 
    {name: 'Incline Push-up', difficulty: intermediate, duration: , instructions: 'Stand in front of your box or bench, then squat or bend down and place both hands on either side of it with your fingers pointing forward. Your hands should be about shoulder-width apart. If you need a wider piece of equipment to safely elevate yourself, donât be shy about swapping it out. Once your hands are in the right position, step your body back into a plank position, one leg at a time. Make sure your body is in a straight line, your head is aligned with your spine, and that your lower back isnât sagging before continuing. Looking a few inches ahead of you, rather than down at the box, can help keep your body straight. Next, bend your arms to help you slowly lower your chest toward the box. Straighten your arms to bring yourself back up into a straight line.
        Repeat 10 times for 3 sets to start. You can increase the repetitions within each set as you get stronger.', type: str_cardio, video_url: }, 
    {name: 'Dumbbell Pullover', difficulty: beginner, duration: , instructions: "Grasp one dumbbell from behind or from side with both hands under inner plate of dumbbell. Position dumbbell over chest with elbows slightly bent. Keeping elbows slightly bent throughout movement, lower dumbbell over and beyond head until upper arms are in-line with torso. Pull dumbbell up and over chest.", type: strength, video_url: }, 
    {name: 'Weighted Chest Dips', difficulty: advanced, duration: , instructions: 'Attach a weight belt to your waist and load the appropriate amount of weight. Grasp the dip bars with your palms facing in. If you can adjust the width of the bars, adjust them to slightly outside shoulder width to emphasize the chest more in the exercise. Jump up and take your bodyweight. Cross your legs at the ankles and lean forward. Keeping your elbows in, slowly lower your body until your shoulders are about level with your elbows. Pause, and then push back up to the starting position. Without locking out your elbows repeat the movement.', type: strength, video_url: }, 
    {name: 'Weighted Standard Push-up', difficulty: advanced, duration: , instructions: 'Get into a push-up position on the floor and have your partner place an appropriate amount of weight on your back. Then, have your partner balance the weights on your back and slowly lower your body down to the desired position. Inhale during this portion of the exercise. Now, push yourself back up so your arms are straight. Exhale during this portion of the exercise.', type: strength, video_url: }, 
    {name: 'Smith Machine Bench Press', difficulty: beginner, duration: , instructions: "Position a flat bench below the barbell of a Smith Machine. Lie on the bench face up and place your hands slightly outside of shoulder width on the barbell. Push the barbell up then immediately rotate it so the hooks turn out. Do not flare out your elbows. Slowly lower the barbell and pause just above your chest. Push the barbell back up to the starting position. Repeat the movement.", type: strength, video_url: }, 
    {name: 'Single-arm Cable Crossover', difficulty: intermediate, duration: , instructions: "Stand sideways to the stack and grip the stirrup with the inside of your hand. Take the tension and take a step back before moving forward into position, keeping feet slightly wider than shoulder width apart. Try to avoid leaning to far forward with this unilateral movement as stability may be compromised. Place your spare hand against your hip for stability. Pull your arm down in front of you forming an arc a foot or so in front of your midriff or in front of your chest if youâre performing a unilateral chest level crossover. Squeeze your pectoral at the end of the motion and return to the starting position. Ensure to keep your core engaged throughout the movement and breathe", type: strength, video_url: }, 
    {name: 'Tricep Dips', difficulty: beginner, duration: , instructions: "Grip the front edges of a chair or bench with your hand. Hover your butt just off and in front of the seat, feet flat, and legs bent so thighs are parallel to the floor. Straighten your arms. This is your start position. Lower your body toward the floor until your arms form 90-degree angles. Then, engage your triceps to press back to start.", type: str_cardio, video_url: }, 
    {name: 'Cable V-bar Pushdown', difficulty: intermediate, duration: , instructions: "Feet shoulder width apart, face a high pulley machine enabled with a V-bar attachment. Grasp the ends of the V-bar so that your palms are facing inward and your elbows are by your waist. This is your starting position. Keeping your body stationary, exhale as you lower the V-bar by completely extending your arms until they are straight down in front of you. Hold for a moment and then inhale as you slowly return the V-bar to the starting position.", type: strength, video_url: }, 
    {name: 'Decline EZ-bar Skull Crusher', difficulty: advanced, duration: , instructions: "Position a loaded EZ bar by the head of a declined bench (15-30 degrees). Hook your feet firmly under the foot pads of the bench and lie supine (on your back). Grasp the EZ bar using a close pronated grip (palms facing away from you) and press it up over your chest until your arms are straight. Allow your arms to tilt backwards a little. Keeping your upper arms fixed, inhale as you flex your elbows and carefully lower the EZ bar toward your face in a circular motion. Exhale as you extend your elbows and return the EZ bar to the starting position.", type: strength, video_url: }, 
    {name: 'Dumbbell Floor Press', difficulty: intermediate, duration: , instructions: "Begin sitting on the floor in an upright position with your legs straight and the dumbbells vertically balanced on the floor. Pick up each dumbbell and set it high in your hip crease while maintaining a tight grip. Slowly lay back while keeping the dumbbells close to your chest and bend your knees to roughly 45 degrees and move your feet up slightly. Press the weights to full extension by contracting your triceps and chest. Slowly lower the weight until both elbows touch the floor then press both dumbbells back to the starting position. To complete the exercise, simply lower the weights to the ground in âcontrolled dropâ fashion. It should be a smooth motion but not one requiring excessive effort or one that puts the shoulder under unnecessary risk.", type: strength, video_url: }, 
    {name: 'Weighted Tricep Dip', difficulty: advanced, duration: , instructions: "Grip the front edges of a chair or bench with your hand. Have a partner place an appropriate weight plate on your thighs. Hover your butt just off and in front of the seat, feet flat, and legs bent so thighs are parallel to the floor. Straighten your arms. This is your start position. Lower your body toward the floor until your arms form 90-degree angles. Then, engage your triceps to press back to start.", type: strength, video_url: }, 
    {name: 'EZ-bar Skull Crusher', difficulty: intermediate, duration: , instructions: "Select your desired weight and sit on the edge of a flat bench. To get into position, lay back and keep the bar close to your chest. Once you are supine, press the weight to lockout. Lower the weights towards your head by unlocking the elbows and allowing the ez bar to drop toward your forehead or just above. Once your forearms reach parallel or just below, reverse the movement by extending the elbows while flexing the triceps to lockout the weight.", type: strength, video_url: }, 
    {name: 'Reverse Grip Triceps Pushdown', difficulty: beginner, duration: , instructions: 'Start by setting a bar attachment (Straight or e-z) on a high pulley machine facing the bar attachment, grab it with the palms facing up (supinated grip) at shoulder width. Lower the bar by using your lats until your arms are fully extended by your sides. Keep your elbows in by your sides and feet should be shoulder width apart from each other. Slowly elevate the bar attachment up as you inhale so it is aligned with your chest. Only the forearms should move and the elbows/upper arms should be stationary by your sides at all times. Lower the cable bar back down to the original starting position while exhaling and contracting the triceps hard', type: strength, video_url: }, 
    {name: 'Kneeling Cable Triceps Extension', difficulty: advanced, duration: , instructions: "Position a bench sideways in front of a high pulley machine. Grasp a straight bar attachment above your head. Your hands should be about 6 inches apart, with your palms facing down. Turn away from the machine and kneel. Put your head on the back of your upper arms on top of the bench. Your elbows should be bent; hold your forearms pointed toward the pulley. This is the starting position. Press the bar out using a semicircular motion until your arms are parallel to the floor. Contract your triceps and hold this position for a second. Exhale as you do so. Return to the starting position, inhaling as you do so.", type: strength, video_url: }, 
    {name: 'Single-arm Cable Triceps Extension', difficulty: intermediate, duration: , instructions: "Set up for the one arm tricep extension by attaching a single grip handle to a high pulley cable and selecting the weight you want to use on the stack. Stand facing the machine and grasp the handle with an overhand (palms facing down) grip. Pull your elbow down and keep it tucked in at your wide. You can use your free arm for support. Keeping your body fixed, slowly extend the arm as far as possible. Pause and squeeze the tricep muscle, and then slowly lower the weight. Repeat this motion for desired reps, and then repeat for the right arm.", type: strength, video_url: }, 
    {name: 'Triceps Pushdown - Rope Attachment', difficulty: intermediate, duration: , instructions: "Face high pulley and grasp rope attachment with clinched hands side by side (palms in). Position elbows to side. Extend arms down. Turn palms down at bottom. Return until forearm is close to upper arm and hands are in original position. Repeat.", type: strength, video_url: }, 
    {name: 'Incline EZ-bar Skull Crusher', difficulty: advanced, duration: , instructions: "Select your desired weight and sit on the edge of an adjustable bench set at 20-30 degrees. To get into position, lay back and keep the bar close to your chest. Once you are supine, press the weight to lockout. Unlock the elbows and allow the ez bar to drop toward your forehead or just above. Once your forearms reach parallel or just below, reverse the movement by extending the elbows while flexing the triceps to lockout the weight.", type: strength, video_url: }, 
    {name: 'Tricep Dumbbell Kickback', difficulty: beginner, duration: , instructions: "Set up for the tricep kickback by grabbing a flat bench and sitting a dumbbell on the left hand side at one end. Position yourself on the left side of the bench with your right knee and right hand resting on the bench. Using a neutral grip, pick up the dumbbell with your left hand. Keep your back straight and look forward. Tuck your left upper arm close to your torso and bend at the elbow, forming a 90 degree angle with your upper arm and forearm. This is the starting position. Moving only at the elbow, raise the dumbbell behind you until your arm is fully extended. Pause, and then lower the dumbbell back to the starting position.", type: strength, video_url: }, 
    {name: 'Palms-up Wrist Curl Over Bench', difficulty: intermediate, duration: , instructions: "Start by picking up a dumbbell in each hand while kneeling over a bench. With your palms facing upwards flex each forearm by lifting and lowering the dumbbell with only your wrist. Exhale while raising your wrist. Inhale while lowering your wrist.", type: strength, video_url: }, 
    {name: 'One-arm Overhead Dumbbell Extension', difficulty: beginner, duration: , instructions: "Brace core and begin with feet shoulder-width apart. Grab a dumbbell with one hand and position it behind head with elbow flexed to 90 degrees. The opposite hand should be placed firmly on hip. Contract tricep and press dumbbell upwards until arm becomes fully extended. Pause and return weight back to starting position.", type: strength, video_url: }, 
    {name: 'Barbell Overhead Shoulder Press', difficulty: beginner, duration: , instructions: "Stand with the bar on your front shoulders, and your hands next to your shoulders. Place your feet at shoulder-width. Press the bar over your head, until itâs balanced over your shoulders and mid-foot. Lock your elbows at the top, and shrug your shoulders to the ceiling.", type: strength, video_url: }, 
    {name: "Standing Lateral Dumbbell Flye", difficulty: beginner, duration: , instructions: "Stand up tall with your feet shoulder-width apart. Keep 1 dumbbell in each hand. Bring your arms up straight in front of you so they're at chest level, palms facing each other. Extend arms out to the sides, until your arms are extended. Bring them back to center.", type: strength, video_url: }, 
    {name: "Standing Dumbbell Front Raise", difficulty: beginner, duration: , instructions: "Stand with feet about shoulder-width apart. Keep the back straight and feet planted flat on the floor. Your arms holding weights should hang down. Hold the dumbbells across the thighs horizontally, palms facing back toward the thighs. Ensure that you have a firm grip. Brace the abdominal muscles. Lift the weights upward, inhaling, with arms out in front and palms facing down. Keep a slight bend in the elbows to reduce the stress on the joints. Pause when the arms are approximately horizontal to the floor and feel the contraction in the shoulders. Return the dumbbells to the starting position at the thighs with a slow and controlled motion while exhaling.", type: strength, video_url: }, 
    {name: "Seated Lateral Dumbbell Flye", difficulty: beginner, duration: , instructions: "Sit at the end of a bench or sturdy surface, a dumbbell in each hand. Arms are at your sides, palms facing in. Place feet firmly and close together. Check your postureâroll your shoulders back, engage your core, and look straight ahead. Raise your arms simultaneously just a couple inches out to each side and pause. This momentary pause should help ensure you disengage your trapezius muscle from the movement, targeting the deltoids as intended. Lift the dumbbells up and out to each side, keeping your arms almost completely straight, stopping when your elbows reach shoulder-height and your body is forming a 'T' shape. Breathe in as you lift. Pause and hold for a second at the top of the movement. Lower the weights slowly (take about twice as long to lower the weights as you took to lift them), bringing your arms back to your sides. Breathe out as you lower the dumbbells.", type: strength, video_url: }, 
    {name: 'Rope Face Pull', difficulty: intermediate, duration: , instructions: "Assume a split stance with the arms straight out in front of you utilizing a pronated grip. Inhale and pull the rope towards your face with the elbows high. Slowly lower the rope back to the starting position and repeat for the desired number of repetitions on both sides.", type: strength, video_url: }, 
    {name: "High Pull", difficulty: intermediate, duration: , instructions: "Start with a barbell on the floor between your feet. Your feet should be set slightly more than shoulder-width apart with toes slightly pointed away. With your spine in a neutral position, bend your knees and lower into a squat position. Using both hands, pick up the barbell at slightly wider than shoulder width and push through your heels. Engage your core as you move back up to your original standing position, pulling the barbell to hip level as you go. Raise the barbell until the handle reaches chin level, pointing your elbows up in the process. Lower the barbell back to your waist and get back into the squat stance.", type: strength, video_url: }, 
    {name: "Clean and Press", difficulty: advanced, duration: , instructions: "Squat down with a straight back and grab the barbell with an overhand grip. In one swift movement, lift the barbell to your shoulders and sink back down into a squat. Push up through your heels and extend your arms to press the barbell above your head. Lower safely to your shoulders and drop back to the floor while maintaining a straight back.", type: strength, video_url: }, 
    {name: "Band Lateral Raise", difficulty: beginner, duration: , instructions: "Place your left foot onto the middle of a resistance band. Step forward with the right. Maintaining a slight bend in the elbows at all times, slowly raise your arms up from the sides of your body. Once your arms reach parallel with the floor, pause, feel the contraction, and slowly lower back down.", type: strength, video_url: }, 
    {name: "Band Front Raise", difficulty: beginner, duration: , instructions: "Holding the handle of a resistance band in each hand, step on the middle of the band with both feet. Stand up straight with a tight core and flat back. Begin by lifting your hands straight up in front of you with an overhand grip. Be sure to keep a slight bend in the elbows at all times. Pause at the top to feel the contraction then slowly lower the bands to the starting position.", type: strength, video_url: }, 
    {name: "Band Bent Over Lateral Raise", difficulty: beginner, duration: , instructions: "Grab an elastic band and hold one end in each hand. Next, step on the middle of the band with feet about hip-width apart. Bend over at your hips about 30 degrees. Keep a natural arch in your lower back. Arms should be perpendicular to the floor. Begin exercise by raising your arms straight out from your sides until they are in line with your shoulders (parallel to the ground). Pause, then slowly lower arms back down to starting position.", type: strength, video_url: }, 
    {name: "Dumbbell W Raise", difficulty: intermediate, duration: , instructions: "Lie down on the incline bench and hold two dumbbells. Keep your arms down inside the direction from the floor together with your arms bent at 90 degrees from your elbows. Raise your bent arms up from your shoulders to form a W. Keep your thumbs up. Pause for a second. Return to your starting position.", type: strength, video_url: }, 
    {name: "Hindu Push-up", difficulty: intermediate, duration: , instructions: "Start in a plank position with hands slightly wider than shoulder-width apart and feet together. Press into the floor with your upper body, and lift your hips up and back into a downward-facing dog pose. Lower your hips until you're back in a push up position while squeezing your butt", type: str_cardio, video_url: }, 
    {name: "Plank", difficulty: beginner, duration: , instructions: "Get in the pushup position, only put your forearms on the ground instead of your hands. Squeeze your glutes and tighten your abdominals. Keep a neutral neck and spine. Create a straight, strong line from head to toes â a plank, if you will. Hold that position.", type: strength, video_url: }, 
    {name: "Lateral Plank Walk", difficulty: advanced, duration: , instructions: "Begin in plank position with your hands underneath your shoulders, and your body in one straight line. Simultaneously cross your right hand toward the left as you step your left foot out to the left. Then simultaneously step your left hand and right foot to the left, returning to the plank position. Your hands move together as your feet step apart. Take two more steps in this direction, keeping your abs pulled toward your spine and your pelvis level. This completes one rep. Reverse direction taking three steps the right.", type: str_cardio, video_url: }, 
    {name: "Dumbbell Neutral Grip Overhead Press", difficulty: beginner, duration: , instructions: "Sit on the bench and bring both dumbbells up by your shoulders with a neutral grip. Then, press the dumbbells overhead but don't lock out your elbows. Slowly lower them back down to shoulder level.", type: strength, video_url: }, 
    {name: 'Rack Deadlift', difficulty: intermediate, duration: , instructions: "Set your rack height. This will be based on your personal height. Set the rack just below the knee or just above the knee to preference. Place the barbell on the rack and add weights. Aim for a similar amount of weight that you use for regular deadlifts. If you are unsure, start with a lower weight and gradually add more weight as needed. Approach the bar so your toes are just under it, pointing straight ahead. Your feet should be shoulder-width apart. Your back should be arched. Point your gaze straight ahead. Bend the knees slightly so your hands wrap around the bar. You can position your hands so that they grip the bar overhand or mixed. Your hands should be just outside of the knees. Once you have a comfortable grip, inhale and begin lifting the bar. As you lift, extend through the hips and knees. You will pull the weight up and back, pulling your shoulders back, until you achieve a lockout. Hold the weight at the top. Return the bar to the rack by bending your knees and lowering your upper body. Keep your back straight and continue to look forward. Exhale as you exit the position.", type: strength, video_url: }, 
    {name: "Snatch-Grip Shrug Pull", difficulty: advanced, duration: , instructions: "Hinge forward, inhale, and grab the bar well outside of shoulder width with a double overhand grip. Stand up tall and ensure your spine remains neutral. Contract the traps to elevate the shoulders. Squeeze hard at the top and slowly lower the bar back to the starting position.", type: strength, video_url: }, 
    {name: 'Snatch-Grip High Pull', difficulty: advanced, duration: , instructions: "Grab the bar 4-6 inches wider then shoulder width apart and stand with your feet about shoulder width apart. Bend at the knees and squat down like you are sitting in a chair. Keep the bar in tight to your body. Stand up and pull the bar up with you. As you pull the bar above your knees bounce the bar slightly off your quads. Now pull the bar up to your sternum and thrust your hips forward as you do. Bring the bar back to your waist and then squat down and set the weight back on the floor.", type: strength, video_url: }, 
    {name: 'Suspension Trainer Pike Push-ups', difficulty: advanced, duration: , instructions: "Get into your suspended plank position, perform a push-up, and then lift hips into a pike. Your body should look a bit like an upside-down V. Your abs will work overtime to bring you up and out of this motion. Be sure to keep legs straight and feet together throughout the movement.", type: str_cardio, video_url: }, 
    {name: 'Suspension Trainer Y-raise', difficulty: advanced, duration: , instructions: "Position body and legs straight at desired angle hanging from handles with arms straight and palms angled inward. Raise arms upward and outward in shape of a Y while keeping arms straight. Return and lower body back in opposite motion until arms are extended straight forward in original position. Repeat.", type: strength, video_url: }, 
    {name: 'Suspension Trainer Rear-Deltoid Raise', difficulty: advanced, duration: , instructions: "Adjust your TRX to mid length, and stand facing the anchor point of the TRX. Walk your feet towards the anchor point and fully extend your arms to chin height. Ensure you go low enough to challenge yourself but not to low that your form is lost. Keep your core nice and tight, extend both arms to make a T shape pulling your body up right but keeping tension in the TRX. Allow both arms to straighten and then lower the body back to start position between reps.", type: strength, video_url: }, 
    {name: "Dumbbell Deadlift/Shrug Combination", difficulty: intermediate, duration: , instructions: "Setup on the trap bar and deadlift the weight up. From the top position, shrug your shoulders directly up towards your ears and hold each shrug for a full second before slowly controlling down. After 3-5 shrugs, lower the trap bar. That's one rep.", type: strength, video_url: }, 
    {name: "Farmer's Walk", difficulty: beginner, duration: , instructions: "Choose a set of kettlebells or dumbbells of equal weight. Make sure to choose a weight that is heavy enough to create resistance, yet light enough that you can keep your form strict and posture upright. Hold one kettlebell or dumbbell in each hand with a tight, firm grip. Stand tall with your feet about shoulder-width apart and arms resting at your sides. Begin the movement by engaging the core muscles, pulling your shoulder blades down and back, and making sure your posture is upright. Take a step forward and begin walking. Be sure to keep your head up, shoulders back, and core muscles contracted the entire time. Continue walking for a specified time or number of steps. To make the move more cardiovascular, increase your pace. You can also increase the number of steps or time based on your fitness level.", type: strength, video_url: }, 
    {name: 'Dumbbell Bent Over Lateral Raise', difficulty: beginner, duration: , instructions: "Standing with a dumbbell in each hand, bend over at the hips until your torso is just about parallel to the floor. Keep your chest out, back flat and your knees slightly bent, and let the dumbbells hang directly beneath you with your elbows straight but not locked out, palms facing each other. Maintaining the same slightly bent position of your elbows throughout, powerfully raise the dumbbells up and out to your sides until your upper arms are about parallel with the floor and at the level of your shoulders. After flexing your rear delts strongly at the top, slowly lower the dumbbells back toward the start position, stopping just short to maintain tension on the muscles, and reverse into the next rep.", type: strength, video_url: }, 
    {name: "Machine Seated Shoulder Press", difficulty: beginner, duration: , instructions: "Keep a tight core and flat back as you remain seated in the shoulder press machine. Look straight ahead as you hold on to the handles. Slowly, press the handles up above your head. Do not lock out your elbow. Slowly, bring the handles back down but do not let the weight stack touch.", type: strength, video_url: }, 
    {name: "Bent Over Reverse Flye", difficulty: intermediate, duration: , instructions: "Maintain a tight core, straight back, and slight knee bend. Exhale and raise both arms out to your side, squeezing the shoulder blades together. Keep a soft bend in your elbows as you pull your shoulder blades toward the spine. Inhale as you lower the weight back to start position.", type: strength, video_url: }, 
    {name: 'Seated Barbell Military Press', difficulty: intermediate, duration: , instructions: "Set up a barbell on a weight rack, so that it is at the same height as your shoulders when seated. Position a flat bench with your back facing the barbell. Keeping your back straight, take the barbell from the rack using on overhand grip, with your hands wider than shoulder width apart. They should be wide enough that your elbows are bent at 90 degrees at the low position. Lift the bar up and slightly over your head by pushing up and locking your arms. This is the start position. Inhale and slowly lower the bar down to shoulder level in a straight line. Hold for a count ofone while squeezing your triceps and shoulder muscles. Exhale and push the bar back up to the start position.", type: strength, video_url: }, 
    {name: "Seated Dumbbell Shoulder Press", difficulty: beginner, duration: , instructions: "Sit on an upright bench holding a dumbbell in each hand at shoulder height with your palms facing away from you. Keep your chest up and your core braced, and look straight forward throughout the move. Press the weights directly upwards until your arms are straight and the weights touch above your head.", type: strength, video_url: }, 
    {name: 'Handstand Shoulder Press', difficulty: advanced, duration: , instructions: "Face a wall in a standing position. Kick your feet up so youâre in a handstand position against a wall. Squeeze your abs, glutes and thigh muscles. Lower yourself toward the ground as far as possible. Push back up and repeat.", type: str_cardio, video_url: }, 
    {name: "Arnold Press", difficulty: intermediate, duration: , instructions: "Hold a dumbbell in each hand with your arm bent, as in the top of a biceps curl, so your palms are facing you. Now, instead of pushing straight up, spread your arms to each side laterally, then press your arms up and twist your hands so your palms face forwards.", type: strength, video_url: }, 
    {name: "Standing Alternating Shoulder Press", difficulty: beginner, duration: , instructions: "Stand with your feet hip-width apart. Hold a dumbbell in each hand just above shoulder height with your palms facing forward and arms bent. Press one dumbbell up over your head without moving the other dumbbell. Stay tall with your chest up and shoulders back. Return to starting position to perform on the other side.", type: strength, video_url: }, 
    {name: "Seated Alternating Shoulder Press", difficulty: beginner, duration: , instructions: "Hold a dumbbell in each hand just above shoulder height with your palms facing forward and arms bent while seated at the edge of a bench. Press one dumbbell up over your head without moving the other dumbbell. Stay tall with your chest up and shoulders back. Return to starting position to perform on the other side.", type: strength, video_url: }, 
    {name: "Behind Neck Press", difficulty: advanced, duration: , instructions: "Sit on a bench, feet planted on the floor and knees at 90 degrees. Squeeze your shoulder blades together and move your elbows back, holding the dumbbells behind your ears. Brace your core. Inhale and slowly return to starting position.", type: strength, video_url: }, 
    {name: "One-arm Dumbbell Shoulder Press", difficulty: beginner, duration: , instructions: "Grab a dumbbell in one hand, and bring it to shoulder-height with your palm facing toward your chest and your arm bent. Stand tall, keep your core tight, and place your feet about shoulder-width apart. Gripping the dumbbell as hard as possible, press it over your head until your arm is almost completely locked out.", type: strength, video_url: }, 
    {name: "Smith Machine Shoulder Press", difficulty: beginner, duration: , instructions: "Sit on a bench with a back support directly underneath the barbell of a Smith machine. Grip the bar with a double overhand grip, slightly wider than shoulder-width apart at just above shoulder height. Gripping the bar as tight as possible, press it overhead until your arms are completely locked out.", type: strength, video_url: }, 
    {name: "Smith Machine Behind Neck Press", difficulty: advanced, duration: , instructions: "Set up for the smith machine shoulder press behind the neck by setting a bench down in the smith machine and adjusting the back to a 90 degree angle. Now sit down on the bench and adjust the position so that the bar comfortably comes down just behind your head. Next, add the weight you want to use and sit down on the bench. Un-rack the weights and bend your elbows slightly. This is the starting position for the movement. Slowly begin lowering the bar down behind your neck as far as comfortably possible. Once your upper arms are slightly past parallel to the floor, pause, and then slowly raise the barbell back up without locking the elbows out at the top of the movement.", type: strength, video_url: }, 
    {name: "Barbell Upright Row", difficulty: beginner, duration: , instructions: "Stand upright with your feet shoulder width apart. Grasp a barbell with your palms facing downward and your hands closer than shoulder width apart. Keep your arms extended downward with your elbows slightly bent so that the barbell is touching your upper legs. This is your starting position. Keeping the barbell close to your body, exhale and raise the barbell straight up to your chest. Hold for a moment and then reverse the motion back to the starting position.", type: strength, video_url: }, 
    {name: "Dumbbell Upright Row", difficulty: beginner, duration: , instructions: "Stand holding a pair of dumbbells at armâs length in front of your waist, palms facing toward you. Slowly lift the weight in front of your torso, keeping it close to your body, until your elbows reach shoulder height. Pause, then reverse the movement, lowering the weights back to the starting position.", type: strength, video_url: }, 
    {name: "Cable Upright Row", difficulty: beginner, duration: , instructions: "Position a cable at the lowest position possible and attach a straight bar. Reach down and grab the handle with a pronated grip and stand up with the arms straight. Take a deep breath then pull the handle high directly up the front of your body by driving your elbows high. Slowly lower the handle back to the starting position under control.", type: strength, video_url: }, 
    {name: "Standing One-arm Lateral Raise", difficulty: beginner, duration: , instructions: "Keeping your body still, eyes facing forward, and arms straight, slowly raise the left dumbbell up to around shoulder height. Pause, and then slowly lower the dumbbell back to starting position. Repeat for desired reps and, and then repeat with your right arm.", type: strength, video_url: }, 
    {name: "Seated One-arm Lateral Raise", difficulty: beginner, duration: , instructions: "Start off sitting down at the end of a flat bench with your feet shoulder width apart and holding a dumbbell in one hand. 2.) While keeping your body still, slowly raise the dumbbell out to the side up to shoulder level, squeezing on the way up and hold for a count.", type: strength, video_url: }, 
    {name: "Incline Bench Lateral Raise", difficulty: intermediate, duration: , instructions: "Sit on an incline bench ~45 degrees and hold a dumbbell in each hand by your side. Raise both dumbbells to your side until they're shoulder height, then lower under control and repeat. Expert tips: Tilt your hands forward to try and get the rear of the dumbbell as level as possible with the front.", type: strength, video_url: }, 
    {name: "Standing One-arm Front Raise", difficulty: beginner, duration: , instructions: "Choose a dumbbell and stand up straight with your feet at around shoulder width apart. Hold the dumbbell with your left arm fully extended down by your thigh in front of you body. Use an overhand grip (palms facing your body). This is the starting position. Begin by raising your left arm straight out in front of you body with your palm facing the floor. Keep a slight bend in your elbow. Moving only at the shoulder and keeping your body as still as possible, continue raising the dumbbell out in front of you until your arm is just above parallel to the floor. Pause for a brief moment at the top of the movement, and slowly lower the dumbbell back to the starting position. Repeat for desired reps, and then repeat the movement with your right arm.", type: strength, video_url: }, 
    {name: "Seated One-arm Front Raise", difficulty: beginner, duration: , instructions: "Start off sitting up straight at the end of a flat bench with your feet shoulder width apart, holding a dumbbell in one hand with an overhand grip at your side. Slowly elevate your arm up towards the ceiling, squeezing your shoulder and hold for a count.", type: strength, video_url: }, 
    {name: "Smith Machine Upright Row", difficulty: beginner, duration: , instructions: "Inhale, brace your abs, and then lead the movement by driving the elbows high as you pull the bar to chest height. When the bar has reached its peak, reverse the movement slowly while controlling the bar back to the starting position.", type: strength, video_url: }, 
    {name: "Rear Deltoid Raise", difficulty: beginner, duration: , instructions: "Grasp dumbbells to each side. Bend knees and bend over through hips with back flat, close to horizontal. Position elbows with slight bend and palms facing together. Raise upper arms to sides until elbows are shoulder height. Maintain upper arms perpendicular to torso and fixed elbow position (10Â° to 30Â° angle) throughout exercise. Maintain height of elbows above wrists by raising 'pinkie finger' side up. Lower and repeat.", type: strength, video_url: }, 
    {name: "Machine Rear Deltoid Row", difficulty: beginner, duration: , instructions: "You will be using a seated row machine. Adjust the seat pad so that your shoulders are parallel with the handles. Grasp the handles of the machine, and pull back using your elbows. Bring your shoulder blades together. Hold for 1-2 seconds, then release back to the starting position.", type: strength, video_url: }, 
    {name: "Lying Rear Deltoid Row", difficulty: intermediate, duration: , instructions: "Lie chest down on elevated bench. Grasp bar with wide overhand grip. Keeping upper arm perpendicular to torso, pull barbell up toward upper chest until upper arms are just beyond parallel to floor. Return and repeat.", type: strength, video_url: }, 
    {name: "Seated Rear Lateral Raise", difficulty: intermediate, duration: , instructions: "Sit on edge of bench with feet placed beyond knees. Bend over and rest torso on thighs. Grasp dumbbells with each hand under legs. Position elbows with slight bend with palms facing together behind ankles (as shown) or just to sides of ankles. Raise upper arms to sides until elbows are shoulder height. Maintain upper arms perpendicular to torso and fixed elbow position (10Â° to 30Â° angle) throughout exercise. Maintain elbows height above wrists by raising "pinkie finger" side up. Lower and repeat.", type: strength, video_url: }, 
    {name: "T-bar Rear Deltoid Row", difficulty: intermediate, duration: , instructions: "Stand on platform, lever between legs. Bend over with back straight and grasp handles with wide overhand grip. Pull lever up, with upper arms perpendicular to torso, until elbows pass shoulders. Bring shoulder blades together. Return, keep arms slightly flexed, repeat.", type: strength, video_url: }, 
    {name: "Smith Machine Rear Deltoid Row", difficulty: intermediate, duration: , instructions: "Start off standing with your feet shoulder-width apart, keeping your knees bend and good posture. Slowly bend forward at your waist until your chest is parallel with the floor. Grab the bar with an overhand grip, making sure that you keep your chest still and pull the bar up as high as possible. Hold briefly then lower the the starting position in a controlled manner. Once you reach the top position, hold for a count and squeeze your back muscles, then return back to the starting position.", type: strength, video_url: }, 
    {name: "Stair Push-ups", difficulty: beginner, duration: , instructions: "On a set of stairs, walk your hands closer than shoulder width and stay on your toes. Keep your body straight and lower your chest towards the stairs. Push yourself back up and repeat.", type: str_cardio, video_url: }, 
    {name: "Standing Barbell Curl", difficulty: beginner, duration: , instructions: "Stand up straight while holding a barbell in a shoulder-width grip. Contract your biceps to curl the weight forward. Your upper arms should remain stationary during this process. Continue moving the barbell until the biceps are fully contracted and the bar is at shoulder height.", type: strength, video_url: }, 
    {name: "Concentration Curl", difficulty: beginner, duration: , instructions: "Select the desired weight from the rack, and sit in an upright position on a flat bench. Hinge forward and position your elbow near the base of your knee. Place your free hand on the other knee to stabilize yourself. Using a supinated (palms facing up) grip, take a deep breath and curl the dumbbell towards your shoulder. Once the bicep is fully shortened, slowly lower the weight back to the starting position. Repeat for the desired number of repetitions on both sides.", type: strength, video_url: }, 
    {name: 'EZ-bar Preacher Curl', difficulty: beginner, duration: , instructions: "Place a barbell on the preacher bench barbell holder and sit on the preacher bench. Place your torso against the preacher bench padding and rest your arms against the arm padding. With your palms facing up, grasp the barbell with arms no wider than shoulder width apart. This is your starting position. Exhale as your raise the barbell to your shoulders. Hold the contraction for a moment as you squeeze the biceps. Inhale as you lower the barbell back toward the starting position.", type: strength, video_url: }, 
    {name: "Dumbbell Preacher Curl", difficulty: beginner, duration: , instructions: "Holding a dumbbell in each hand, sit on the preacher bench. With your elbows flexed, place the backs of your upper arms flat on the arm rest. Supinate your wrists (i.e. rotate them so that your palms face you). Keeping your wrists supinated, inhale as you lower the dumbbells until your elbows are almost fully extended. Exhale as you curl the dumbbells back up toward your shoulders. At the top of the movement, hold for a count of two and squeeze your biceps brachii.", type: strength, video_url: }, 
    {name: "Machine Preacher Curl", difficulty: beginner, duration: , instructions: "Sit down on the preacher curl machine. Choose the weight you want to use. Position your triceps on the preacher pad and grasp the handles with an underhand grip. This is the starting position. Lift the handles and contract your biceps. You should be exhaling as you do so. Hold the contraction at the top of the position for a second. Lower the handles back to the starting position; inhaling as you do so.", type: strength, video_url: }, 
